export class SurveyChoice {
  constructor(q, a, key) {
    this.question = q;
    this.answer = a;
    this.key = key;
  }
  getAnswer() {
    return this.answer;
  }
  getKey() {
    return this.key;
  }
  toString() {
    return this.question + " (" + this.key + ")" + ": " + this.answer;
  }
}
